import React from 'react';
import './BrandBoard.css';

function BrandBoard() {
  // Example brand data
  const brands = [
    { id: 1, logo: 'brand-a-logo.png' },
    { id: 2, logo: 'brand-b-logo.png' },
    { id: 3, logo: 'brand-c-logo.png' },
    // Add more brands here
  ];

  return (
    <div className='brand-board-main'>
      <h2>Featured Brands</h2>
      <div className='brand-list-container'>
        <div className='brand-list'>
          {brands.map(brand => (
            <div className='brand-box' key={brand.id}>
              <img src={brand.logo} alt={`Brand ${brand.id}`} />
              <div className='brand-name'>Brand {brand.id}</div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default BrandBoard;
